from runner import Runner
import sys

class TodayRunner(Runner):
    def parse(self, input):
        self.width = len(input[0])
        self.height = len(input)
        self.input = input
        self.right_found = 0
        self.left_found = 0
        return input

    def left(self, i, j):
        if j == 0:
            return None
        return (i, j-1)
    
    def right(self, i, j):
        if j == self.width - 1:
            return None
        return (i, j+1)

    def up(self, i, j):
        if i == 0:
            return None
        return (i-1, j)
    
    def up_right(self, i, j):
        if i == 0 or j == self.width - 1:
            return None
        return (i-1, j+1)
    
    def up_left(self, i, j):
        if i == 0 or j == 0:
            return None
        return (i-1, j-1)
    
    def down(self, i, j):
        if i == self.height - 1:
            return None
        return (i+1, j)
    
    def down_right(self, i, j):
        if i == self.height - 1 or j == self.width - 1:
            return None
        return (i+1, j+1)
    
    def down_left(self, i, j):
        if i == self.height - 1 or j == 0:
            return None
        return (i+1, j-1)
    
    def go_direction(self, i, j, dir):
        if dir == 'down':
            return self.down(i, j)
        if dir == 'up':
            return self.up(i, j)
        if dir == 'left':
            return self.left(i, j)
        if dir == 'right':
            return self.right(i, j)
        if dir == 'down-right':
            return self.down_right(i, j)
        if dir == 'down-left':
            return self.down_left(i, j)
        if dir == 'up-right':
            return self.up_right(i, j)
        if dir == 'up-left':
            return self.up_left(i, j)
        
    def check_direction(self, i, j, dir):
        found = True
        for ch in 'MAS':
            result = self.go_direction(i, j, dir)
            if not result:
                return False
            else:
                (i, j) = result
                if self.input[result[0]][result[1]] != ch:
                    found = False

        if found and dir == 'left':
            self.left_found += 1
        
        if found and dir == 'right':
            self.right_found += 1
        return found

    def check_directions(self, i, j):
        count = 0
        
        for direction in ['down', 'up', 'left', 'right', 'down-left', 'down-right', 'up-left', 'up-right']:
            if self.check_direction(i, j, direction):
                count += 1
    
        return count

    def get_direction(self, i, j, dir):
        result = self.go_direction(i, j, dir)
        if not result: 
            return ''
        return self.input[result[0]][result[1]]

    def check_x_mas(self, i, j):
        up_left = self.get_direction(i, j, 'up-left')
        up_right = self.get_direction(i, j, 'up-right')
        down_left = self.get_direction(i, j, 'down-left')
        down_right = self.get_direction(i, j, 'down-right')

        if up_left == 'M' and up_right == 'M' and down_left == 'S' and down_right == 'S':
            return 1
        if up_left == 'S' and up_right == 'S' and down_left == 'M' and down_right == 'M':
            return 1
        if up_left == 'M' and up_right == 'S' and down_left == 'M' and down_right == 'S':
            return 1
        if up_left == 'S' and up_right == 'M' and down_left == 'S' and down_right == 'M':
            return 1
        
        return 0

    
    def exec(self, input):
        count = 0
        for i in range(self.height):
            for j in range(self.width):
                if self.input[i][j] == 'A':
                    count += self.check_x_mas(i, j)
                    # count += self.check_directions(i, j)
        return count


